  Ottawa and Christchurch. Nowadays he plays the bassoon in a chamber music group and two amateur
  orchestras, one of which made a six-week tour to cathedral cities in Britain, France, Germany, Poland,
  Hungary, Austria and Italy at the end of 1990.
  Mary was educated at Wellington Girls' College and Victoria University (BSc). In Manchester she worked
  as a chemist at the Wythenshawe laboratory of the British Rayon Research Association. During the years
  she spent in Ottawa she developed a strong interest in hand-built pottery which continued after
  returning to New Zealand in 1972.
  01> MACLEAN, Alison Margaret
  b 31.07.1958
  Alison b. at Ottawa, Canada.
  Alison was educated at Burnside High School in Christchurch, Canterbury University and Auckland
  University (BFA). She has written and directed films in Auckland and Sydney ("Talkback", "Kitchen
  Sink", "Crush") and is currently working as a free-lance film director in New York.
  02> MACLEAN, Roger Francis m on 23.11.1985 to PRIESTLEY, Dinah Margaret
  b 10.06.1960
  b 01.10.1964
  Roger b. at Ottawa, Canada and m. at Christchurch. Dinah, d/o Clive Brian Priestley and Vera
  Pennell, b. at Birmingham, England. Address: 90 St Claire Avenue, Nepean, Ontario K2G2A6, Canada.
  Roger was educated at Burnside High School and the University of Canterbury, graduating with a
  BE(Hons) degree in 1981 and an ME in Mechanical Engineering in 1982. He worked for the North
  Canterbury Hospital Board until 1985, where he was in charge of a FACS IV Flow Cytometer, an
  instrument for analysing and sorting cell samples.
  Dinah moved with her family to Christchurch in 1974 and attended Rangi Ruru Girls' School. She
  then graduated MA in Economics from the University of Canterbury and worked for the Department of
  the Treasury in Wellington for two years.
  After their marriage, Roger and Dinah moved to Lower Hutt where Roger worked until 1988 in the
  Physics and Engineering Laboratory of what was then the Department of Scientific and Industrial
  Research. There he was responsible for writing and maintaining computer aided design (CAD)
  software for VLSI and thick film circuit design. They moved to Ottawa, Canada in 1988 and until
  1993 Roger worked as a software engineer for GeoVisions Systems Inc, a software company that built
  a Geographic Information System called Vision. In 1993, after GeoVision's bankruptcy, he joined
  SHL" Systemhouse Inc as a technical architect working on the same software as at GeoVision
  (Systemhouse had purchased the assets following the bankruptcy). He left Systemhouse at the end of
  1994 and joined a newly-formed company called Televitesse Systems Inc as its third employee. There
  he is one of the main architects and developers for its product, accesTV, a PC software product for
  searching and recording broadcast television signals and distributing them over computer networks.
  After moving to Ottawa, Dinah worked for two years as a consultant with an economic consulting firm
  called Global Economics. Since 1990 she has worked for the Bank of Canada where currently she is
  working part-time as a senior economist on issues related to the quarterly projection and model
  development.
  Roger enjoys reading, music, computers, biking, canoeing and cross country skiing whilst Dinah's
  interests include reading, music, canoeing and cross country skiing. She sings in an amateur
  choir.
  01> MACLEAN, Nicholas Charles
  b 31.01.1991
  Nicholas b. at Ottawa, Canada.
